import  { FC } from 'React';
import styled from 'styled-components';

import { Wrapper } from '../../styledHelpers/Components';
import { Colors } from '../../styledHelpers/colors';
import {
    Link
} from "react-router-dom";


const LeftPanel = styled.div`
width:200px;
height:300px;



`;
const TopPanel = styled.div`
height:200px;
width:200px;
margin-left:10px;
margin-top:10px;
padding-left:10px;
padding-top:10px;
box-shadow:2px 4px 8px 1px #8e8e8e;
border-radius:5px;
`;
/*const MidPanel = styled.div`
height: 50px;
width:200px;
text-align: left;
clear: both;
padding-left:10px;
margin-top:10px;
margin-left:10px;
padding-top:10px;
box-shadow:4px 4px 8px 1px #8e8e8e;
padding-top:15px;
border-radius:5px;
`;
*/
const BottomPanel = styled.div`
padding-left:10px;
margin-top:10px;
margin-left:10px;
`;

const PubICon = styled.div`
padding-top:10px;
`;
const EcoICon = styled.div`
padding-top:10px;
`;
const EntIcon = styled.div`
padding-top:10px;
`;
const PartOne = styled.div`
`;
const PartTwo = styled.div`
padding-top:7px;
`;
const Logo = styled.img`
height:50%;
width:50%;
margin-left:30px;
margin-top:20px;
`;
const Title =styled.label`
margin-left:30px;
margin-top:20px;
`;
const ItemLink = styled.div`
margin-left:-10px;
height: 1px;
width: 200px;
background-color: gray;
display:flex;
`;

export const LeftMenu: FC = () => {
    return (
        <LeftPanel>
            <TopPanel>
                <Title>job title company</Title> 
                <Logo src="./media/icons/logo.png"/> 
                <ItemLink></ItemLink>
                <PartOne>
                    <img src="./media/icons/network.png" alt=""></img>
                    <Link to= "/YourNetwork" style={{padding:"20px"}}  >Your Network</Link>
                    <img src="./media/icons/user-plus.png"  alt=""></img>
                </PartOne>
                <PartTwo>
                    <img src="./media/icons/publications.png" alt=""></img>
                    <Link to= "YourPublications" style={{padding:"20px"}}  >Your Publications</Link>
                    <img src="./media/icons/plus.png" alt="" ></img>
                </PartTwo>

            </TopPanel>
          
            <BottomPanel>
                <PubICon>
                    <img src="./media/icons/publications.png" alt=""></img>
                    <Link to= "/publications" style={{padding:"10px"}}  >publications</Link>
                </PubICon>
                <EcoICon>
                    <img src="./media/icons/ecosystem.png" alt=""></img>
                    <Link to= "/ecosystem" style={{padding:"10px"}}  >ecosystem</Link>
                </EcoICon>
                <EntIcon>
                    <img src="./media/icons/entities.png"alt=""></img>
                    <Link to= "/entities" style={{padding:"10px"}}  >entities</Link>
                </EntIcon>

            </BottomPanel>
        </LeftPanel>
    );
};
